import React from "react";
import "../style/Navigation.scss";

function Navigation() {
  return (
    <header className="header">
        <nav className="header__nav">
          <ul>
              <li> 
                <link to="#about-secton">About Me</link> 
              </li>
              <li> 
                Games 
              </li>
          </ul>
        </nav>
    </header>
  );
}

export default Navigation
